import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import HelpIcon from '@material-ui/icons/Help';
import SettingsIcon from '@material-ui/icons/Settings';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import { blue } from '@material-ui/core/colors';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
    backgroundColor: blue[900],
    color: '#fff',
  },
  drawerPaper: {
    width: drawerWidth,
    backgroundColor: blue[900],
    color: '#fff',
  },
  drawerHeader: {
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
  },
}));

function SideNav(props) {
  const classes = useStyles();

  const handleHelpClick = () => {
    // handle help click
  };

  const handleSettingsClick = () => {
    // handle settings click
  };

  const handleLogoutClick = () => {
    // handle logout click
  };

  return (
    <div className={classes.root}>
      <Drawer
        className={classes.drawer}
        variant="persistent"
        anchor="left"
        open={props.open}
        classes={{
          paper: classes.drawerPaper,
        }}
      >
        <div className={classes.drawerHeader}>
          <IconButton onClick={props.handleDrawerClose}>
            <ChevronLeftIcon style={{ color: '#fff' }} />
          </IconButton>
        </div>
        <Divider />
        <List>
          {props.menuItems.map((menuItem, index) => (
            <ListItem button key={menuItem.text}>
              <ListItemIcon style={{ color: '#fff' }}>{menuItem.icon}</ListItemIcon>
              <ListItemText primary={menuItem.text} />
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          <ListItem button key="Help" onClick={handleHelpClick}>
            <ListItemIcon style={{ color: '#fff' }}><HelpIcon /></ListItemIcon>
            <ListItemText primary="Help" />
          </ListItem>
          <ListItem button key="Settings" onClick={handleSettingsClick}>
            <ListItemIcon style={{ color: '#fff' }}><SettingsIcon /></ListItemIcon>
            <ListItemText primary="Settings" />
          </ListItem>
        </List>
        <Divider />
        <List>
          <ListItem button key="Logout" onClick={handleLogoutClick}>
            <ListItemIcon style={{ color: '#fff' }}><ExitToAppIcon /></ListItemIcon>
            <ListItemText primary="Logout" />
          </ListItem>
        </List>
      </Drawer>
    </div>
  );
}

export default SideNav;
